import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Grid } from "arclight-react";
import Card from "../Card/Card";

const _Grid = styled.div``;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Grid>
          <Grid
            theme={"Dark"}
            itemsPerRow={8}
            height={"600px"}
            items={[<Card />]}
          />
        </_Grid>
      </ThemeProvider>
    );
  }
}
